import React from 'react';
import Profile from "./profile";
import {connect} from "react-redux";
import {addProfileData, getStatus, putStatus} from "../../../redux/content-reducer";
import {userAPI} from "../../../API/api";
import {withRouter} from "react-router-dom";

 class ProfileContainer extends React.Component{
     componentDidMount() {
          let userId =this.props.match.params.userId;
         this.props.addProfileData(userId);
         this.props.getStatus(userId);
         this.props.putStatus(userId);
     }
     render() {
         return <Profile
             {...this.props}
             profile={this.props.profile}
             status={this.props.status}
         />
     }
 }
let mapStateToProps = (state)=>({
    profile:state.ProfilePage.profile,
    status:state.ProfilePage.status
});
 let withRouterProfile = withRouter(ProfileContainer);
 const ProfileContainerExport = connect(mapStateToProps,{addProfileData,getStatus,putStatus})(withRouterProfile);
 export default ProfileContainerExport;
